import React from "react";
import { useSpring, animated } from "@react-spring/web";

type RectangleProps = {
  width: number;
  height: number;
  x: number;
  y: number;
  fill?: string;
};

export const Rectangle = (props: RectangleProps) => {
  const { x, y, width, height, fill = "#9d174d" } = props;

  const springProps = useSpring({
    from: { 
      x, 
      y: height, // Start from the bottom
      width,
      height: 0 // Start with zero height
    },
    to: { 
      x,
      y,
      width,
      height
    },
    config: { 
      mass: 1,
      tension: 180,
      friction: 12
    }
  });

  // Cast animated.rect to a component that accepts x, y, width, and height as either a number or a spring value.
  const AnimatedRect = animated.rect as React.FC<
    React.SVGProps<SVGRectElement> & {
      x: number | typeof springProps.x;
      y: number | typeof springProps.y;
      width: number | typeof springProps.width;
      height: number | typeof springProps.height;
    }
  >;

  return (
    <AnimatedRect
      style={{
        x: springProps.x.to((val) => val),
        y: springProps.y.to((val) => val),
        width: springProps.width.to((val) => val),
        height: springProps.height.to((val) => val),
        opacity: 0.7,
        stroke: fill,
        fill: fill,
        fillOpacity: 0.3,
        strokeWidth: 1
      }}
      rx={1}
    />
  );
};

export default Rectangle;
